// RUN: objc3c -fobjc-version=3 -fobjc3-strictness=strict --emit-module EXE05.objcmod --emit-interface EXE05.obji --emit-interface-mode=text --emit-interface-format=deterministic %s
// RUN: objc3c --emit-module EXE05-import.objcmod --import-interface EXE05.obji --emit-interface EXE05-roundtrip.obji --emit-interface-mode=text --emit-interface-format=deterministic
// RUN: objc3c --verify-interface EXE05.objcmod EXE05-roundtrip.obji %s
// RUN: objc3c --verify-interface EXE05-import.objcmod EXE05.obji %s
@interface EXE05Queue : NSObject
- (id _Nonnull)drainStep:(id _Nonnull)token async __attribute__((objc_executor(global)));
- (id _Nonnull)finishOnMain:(id _Nonnull)token async __attribute__((objc_executor(main)));
@end

id _Nonnull exe05_progress(EXE05Queue * _Nonnull queue, id _Nonnull seed) async __attribute__((objc_executor(global))) {
    id _Nonnull drained = await [queue drainStep:seed];
    return await [queue finishOnMain:drained];
}
